import React from 'react';

/*Componentes */
import styles from '../css/Propiedad.module.css';

/*JSONs */
import dataProps from "../data.json";

function Propiedad(props){
    return(
    <div>
      <div className={styles.row}>
        <h1 className={styles.namePropiedad}>Nombre de la Propiedad</h1>
        <h2 className={styles.directionPropiedad}>Direccion de la Propiedad</h2>
        <h3 className={styles.pricePropiedad}>XXX USD</h3>
      </div>
        <img 
          className={styles.imagePropiedad}
          //src={require(`../images/${props.imagen}.png`)}
          alt={"Imagen de Propiedad " + dataProps.nombre}/>
        <p className='descriptionPropiedad'>Descriopcion de la propiedad</p>
    </div>
    );
}

export default Propiedad;
